import React, { useEffect, useState } from 'react';
import axios from 'axios';

interface CourseResult {
  subject: string;
  code: string;
  title: string;
  description: string;
}

export const CourseSearch = (): JSX.Element => {
  const [query, setQuery] = useState('');
  const [subjectParam, setSubjectParam] = useState('');
  const [codeParam, setCodeParam] = useState('');
  const [courseResults, setCourseResults] = useState<CourseResult[]>([]);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setQuery(e.target.value);
  };

  const handleSubjectParamChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setSubjectParam(e.target.value);
  };

  const handleCodeParamChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setCodeParam(e.target.value);
  };

  const handleFormSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    axios
      .post('http://localhost:5000/api/search', { 
        courseQuery: query,
        subject_param: subjectParam,
        code_param: codeParam,
    })
      .then((response) => {
        setCourseResults(response.data.result);
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  };

  return (
    <section className="bg-white text-blue-900 mt-16 min-h-screen w-screen font-sans">
      <div className="container flex flex-col items-center justify-center mx-auto h-full overflow-auto py-16">
        <h1 className="text-4xl font-bold mb-4">Course Search</h1>
        <p className="text-lg mb-2">Enter a query for courses:</p>
        <form onSubmit={handleFormSubmit} className="flex flex-col items-center mb-4">
            <div className="mb-4">
                <input
                type="text"
                placeholder="ex. arabic literature"
                value={query}
                onChange={handleInputChange}
                className="px-2 py-3 border border-blue-900 rounded-md focus:outline-none
                focus:ring-2 focus:ring-blue-700 text-blue-800 h-20 max-w-full overflow-y-hidden break-words"
                name="courseQuery"
                />
            </div>
            <div className="mb-4 flex flex-col items-center">
                <p className="text-lg mb-2">Enter desired course department (optional):</p>
                <input
                type="text"
                placeholder="ex. CIS"
                value={subjectParam}
                onChange={handleSubjectParamChange}
                className="px-2 py-3 border border-blue-900 rounded-md focus:outline-none
                focus:ring-2 focus:ring-blue-700 text-blue-800 h-20 max-w-full overflow-y-hidden break-words"
                name="subjectParam"
                />
            </div>
            <div className="mb-4 flex flex-col items-center">
                <p className="text-lg mb-2">Select course level by starting digit:</p>
                <div className="flex items-center">
                    <input
                    type="radio"
                    id="codeParam1"
                    value="1"
                    checked={codeParam === "0"}
                    onChange={() => setCodeParam("0")}
                    className="mr-2"
                    />
                    <label htmlFor="codeParam1" className="mr-4">Any</label>
                    <input
                    type="radio"
                    id="codeParam1"
                    value="1"
                    checked={codeParam === "1"}
                    onChange={() => setCodeParam("1")}
                    className="mr-2"
                    />
                    <label htmlFor="codeParam1" className="mr-4">1XXX</label>
                    <input
                    type="radio"
                    id="codeParam2"
                    value="2"
                    checked={codeParam === "2"}
                    onChange={() => setCodeParam("2")}
                    className="mr-2"
                    />
                    <label htmlFor="codeParam2" className="mr-4">2XXX</label>
                    <input
                    type="radio"
                    id="codeParam3"
                    value="3"
                    checked={codeParam === "3"}
                    onChange={() => setCodeParam("3")}
                    className="mr-2"
                    />
                    <label htmlFor="codeParam3" className="mr-4">3XXX</label>
                    <input
                    type="radio"
                    id="codeParam4"
                    value="4"
                    checked={codeParam === "4"}
                    onChange={() => setCodeParam("4")}
                    className="mr-2"
                    />
                    <label htmlFor="codeParam4">4XXX</label>
                </div>
            </div>

            <button
                type="submit"
                className="bg-blue-900 hover:bg-blue-700 text-white px-6 py-3 rounded-md transition-colors duration-300"
            >
                Generate courses
            </button>
            </form>

        {courseResults.length > 0 && (
          <div>
            {courseResults.map((courseResult, index) => (
              <div key={index} >
                <h2>{courseResult.subject} {courseResult.code} - {courseResult.title}</h2>
                <p>{courseResult.description}</p>
              </div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
};
